INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 4, "カオリ（サマー）", 1, 24, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 110501, 10021, 24015, "2019/07/31 12:00:00", 0.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 1, "カオリ（サマー）", 2, 24, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 110501, 10021, 24016, "2019/07/31 12:00:00", 4.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 4, "カオリ（サマー）", 3, 24, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 110501, 10021, 24017, "2019/07/31 12:00:00", 0.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 2, "カオリ（サマー）", 4, 24, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 110501, 10021, 24018, "2019/07/31 12:00:00", 5.2, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 6, "カオリ（サマー）", 5, 24, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 110501, 10021, 24019, "2019/07/31 12:00:00", 4.2, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 2, "カオリ（サマー）", 6, 24, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 110501, 10021, 24020, "2019/07/31 12:00:00", 0.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 6, "カオリ（サマー）", 7, 24, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 110501, 10021, 24021, "2019/07/31 12:00:00", 6.4, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 2, "カオリ（サマー）", 8, 24, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 110501, 10021, 24022, "2019/07/31 12:00:00", 0.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 3, "カオリ（サマー）", 9, 24, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 110501, 10021, 24023, "2019/07/31 12:00:00", 10.08, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 2, "カオリ（サマー）", 10, 24, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 110501, 10021, 24024, "2019/07/31 12:00:00", 5.0, 0.0);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 2, "カオリ（サマー）", 11, 24, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 110501, 10021, 24025, "2019/07/31 12:00:00", 0.0, 0.0);
